          </Stack.Navigator>
        </NavigationContainer> */}
        {/* <SignIn /> */}
        <NavigationContainer>
      <Stack.Navigator initialRouteName="Home">
        <Stack.Screen name="Home" component={HomeScreen} />
        <Stack.Screen name="Details" component={DetailsScreen} />
      </Stack.Navigator>
    </NavigationContainer>
      </View>
    );
  }
}

const styles = StyleSheet.create({
  container: {},
});

